import '../../styles/Card.css';

function Card({ label, title, picture }) {
    return (
        <span class="wrapper">
            <div class="mx-4 col-5">
                <span className="label">{label}</span>
                <img src={picture} alt="freelance" />
                <span>{title}</span>
            </div>
        </span>
    )
}

export default Card
